public class InnerUserPoolLambdaConfigFactory(Action<Humidifier.Cognito.UserPoolTypes.LambdaConfig> factoryAction = null) : SubResourceFactory<Humidifier.Cognito.UserPoolTypes.LambdaConfig>
{

    internal InnerUserPoolCustomSMSSenderFactory CustomSMSSenderFactory { get; set; }

    internal InnerUserPoolPreTokenGenerationConfigFactory PreTokenGenerationConfigFactory { get; set; }

    internal InnerUserPoolCustomEmailSenderFactory CustomEmailSenderFactory { get; set; }

    protected override Humidifier.Cognito.UserPoolTypes.LambdaConfig Create()
    {
        var lambdaConfigResult = CreateLambdaConfig();
        factoryAction?.Invoke(lambdaConfigResult);

        return lambdaConfigResult;
    }

    private Humidifier.Cognito.UserPoolTypes.LambdaConfig CreateLambdaConfig()
    {
        var lambdaConfigResult = new Humidifier.Cognito.UserPoolTypes.LambdaConfig();

        return lambdaConfigResult;
    }
    public override void CreateChildren(Humidifier.Cognito.UserPoolTypes.LambdaConfig result)
    {
        base.CreateChildren(result);

        result.CustomSMSSender ??= CustomSMSSenderFactory?.Build();
        result.PreTokenGenerationConfig ??= PreTokenGenerationConfigFactory?.Build();
        result.CustomEmailSender ??= CustomEmailSenderFactory?.Build();
    }

} // End Of Class

